import React from "react";
import {Link} from "react-router-dom"
import Navbar from "../Navbar/Navbar";
import { Button } from "@chakra-ui/react";

const Home = () => {
  return (
    <div>
      <Link to ="/QuestionChoice">
        <Button>
          Start Quiz 
        </Button>
      </Link>
      <Navbar />
      
    </div>
  );
};

export default Home;
